import React from "react";

import { Route } from "react-router-dom";

// components
import Listsalon from "./listofsalons/listsalons";
import Navbarclient from "./Menu/menuclient";
import Footer from "../footer/footer";
import Meetinglist from "../client/rendez-vous/meetingslist";

function Indexclient() {
  return (
    <div>
      <Navbarclient />
      <div>
        <Route exact path="/client">
          home
        </Route>
        <Route exact path="/client/listofsalons">
          <Listsalon />
        </Route>
        <Route path="/client/meetings">
          <Meetinglist />
        </Route>
        <Route path="/client/profil">profil</Route>
      </div>
      <Footer />
    </div>
  );
}

export default Indexclient;
